    "All accounts were created successfully.": "\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e44\u0e14\u0e49\u0e2d\u0e22\u0e48\u0e32\u0e07\u0e1b\u0e23\u0e30\u0e2a\u0e1a\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e33\u0e40\u0e23\u0e47\u0e08",
    "All chapters must have a name and asset": "T\u1ea5t c\u1ea3 c\u00e1c ch\u01b0\u01a1ng ph\u1ea3i c\u00f3 t\u00ean v\u00e0 li\u00ean k\u1ebft ch\u01b0\u01a1ng",
    "All groups must have a name.": "\u0e17\u0e38\u0e01\u0e01\u0e25\u0e38\u0e48\u0e21\u0e15\u0e49\u0e2d\u0e07\u0e23\u0e30\u0e1a\u0e38\u0e0a\u0e37\u0e48\u0e2d",
