    "All payment options are currently unavailable.": "T\u1ea5t c\u1ea3 t\u00f9y ch\u1ecdn thanh to\u00e1n hi\u1ec7n kh\u00f4ng s\u1eed d\u1ee5ng \u0111\u01b0\u01a1\u0323c.",
    "All professional education courses are fee-based, and require payment to complete the enrollment process.": "\u0e17\u0e38\u0e01\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23\u0e01\u0e32\u0e23\u0e28\u0e36\u0e01\u0e29\u0e32\u0e21\u0e37\u0e2d\u0e2d\u0e32\u0e0a\u0e35\u0e1e\u0e17\u0e35\u0e48\u0e21\u0e35\u0e04\u0e48\u0e32\u0e17\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e41\u0e25\u0e30\u0e15\u0e49\u0e2d\u0e07\u0e0a\u0e33\u0e23\u0e30\u0e40\u0e07\u0e34\u0e19\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e43\u0e2b\u0e49\u0e40\u0e2a\u0e23\u0e47\u0e08\u0e2a\u0e34\u0e49\u0e19\u0e01\u0e23\u0e30\u0e1a\u0e27\u0e19\u0e01\u0e32\u0e23\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19",
    "All subsections": "\u0e40\u0e0b\u0e04\u0e0a\u0e31\u0e48\u0e19\u0e22\u0e48\u0e2d\u0e22\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14",
    "All teams": "\u0e17\u0e35\u0e21\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14",
    "All topics": "\u0e2b\u0e31\u0e27\u0e02\u0e49\u0e2d\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14",
    "All units": "\u0e2b\u0e19\u0e48\u0e27\u0e22\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14",
    "Allow others to copy, distribute, display and perform only verbatim copies of your work, not derivative works based upon it. This option is incompatible with \"Share Alike\".": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, hi\u1ec3n th\u1ecb v\u00e0 tr\u00ecnh di\u1ec5n ch\u1ec9 c\u00e1c b\u1ea3n sao nguy\u00ean b\u1ea3n c\u1ee7a t\u00e1c ph\u1ea9m c\u1ee7a b\u1ea1n ch\u1ee9 kh\u00f4ng ph\u1ea3i c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh d\u1ef1a tr\u00ean n\u00f3. T\u00f9y ch\u1ecdn n\u00e0y kh\u00f4ng t\u01b0\u01a1ng th\u00edch v\u1edbi \"Chia s\u1ebb t\u01b0\u01a1ng t\u1ef1\".",
    "Allow others to copy, distribute, display and perform your copyrighted work but only if they give credit the way you request. Currently, this option is required.": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, tr\u01b0ng b\u00e0y v\u00e0 tr\u00ecnh di\u1ec5n t\u00e1c ph\u1ea9m c\u00f3 b\u1ea3n quy\u1ec1n c\u1ee7a b\u1ea1n nh\u01b0ng ch\u1ec9 khi h\u1ecd cung c\u1ea5p t\u00edn d\u1ee5ng theo c\u00e1ch b\u1ea1n y\u00eau c\u1ea7u. Hi\u1ec7n t\u1ea1i, t\u00f9y ch\u1ecdn n\u00e0y l\u00e0 b\u1eaft bu\u1ed9c.",
    "Allow others to copy, distribute, display and perform your work - and derivative works based upon it - but for noncommercial purposes only.": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, tr\u01b0ng b\u00e0y v\u00e0 tr\u00ecnh di\u1ec5n t\u00e1c ph\u1ea9m c\u1ee7a b\u1ea1n - v\u00e0 c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh d\u1ef1a tr\u00ean n\u00f3 - nh\u01b0ng ch\u1ec9 cho c\u00e1c m\u1ee5c \u0111\u00edch phi th\u01b0\u01a1ng m\u1ea1i.",
    "Allow others to distribute derivative works only under a license identical to the license that governs your work. This option is incompatible with \"No Derivatives\".": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c ph\u00e2n ph\u1ed1i c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh ch\u1ec9 theo m\u1ed9t gi\u1ea5y ph\u00e9p gi\u1ed1ng v\u1edbi gi\u1ea5y ph\u00e9p chi ph\u1ed1i c\u00f4ng vi\u1ec7c c\u1ee7a b\u1ea1n. T\u00f9y ch\u1ecdn n\u00e0y kh\u00f4ng t\u01b0\u01a1ng th\u00edch v\u1edbi \"Kh\u00f4ng Ph\u00e1i sinh\".",
    "Allow students to generate certificates for this course?": "\u0e2d\u0e19\u0e38\u0e0d\u0e32\u0e15\u0e43\u0e2b\u0e49\u0e19\u0e31\u0e01\u0e40\u0e23\u0e35\u0e22\u0e19\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e43\u0e1a\u0e23\u0e31\u0e1a\u0e23\u0e2d\u0e07\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23\u0e19\u0e35\u0e49 ?",
    "Already a course team member": "\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e21\u0e32\u0e0a\u0e34\u0e01\u0e17\u0e35\u0e21\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23\u0e40\u0e23\u0e35\u0e22\u0e1a\u0e23\u0e49\u0e2d\u0e22",
    "Already a library team member": "\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e21\u0e32\u0e0a\u0e34\u0e01\u0e17\u0e35\u0e21\u0e2b\u0e49\u0e2d\u0e07\u0e2a\u0e21\u0e38\u0e14\u0e40\u0e23\u0e35\u0e22\u0e1a\u0e23\u0e49\u0e2d\u0e22",
    "Already a member": "\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e21\u0e32\u0e0a\u0e34\u0e01\u0e41\u0e25\u0e49\u0e27",
    "Alternative source": "Ngu\u1ed3n thay th\u1ebf",
    "Always show assessment results": "Lu\u00f4n lu\u00f4n hi\u1ec3n th\u1ecb k\u1ebft qu\u1ea3 \u0111\u00e1nh gi\u00e1",
    "An error has occurred. Check your Internet connection and try again.": "M\u1ed9t l\u1ed7i \u0111\u00e3 x\u1ea3y ra. Ki\u1ec3m tra k\u1ebft n\u1ed1i Internet c\u1ee7a b\u1ea1n v\u00e0 th\u1eed l\u1ea1i.",
    "An error has occurred. Make sure that you are connected to the Internet, and then try refreshing the page.": "\u0e04\u0e27\u0e32\u0e21\u0e1c\u0e34\u0e14\u0e1e\u0e25\u0e32\u0e14\u0e40\u0e01\u0e34\u0e14\u0e02\u0e36\u0e49\u0e19 \u0e42\u0e1b\u0e23\u0e14\u0e41\u0e19\u0e48\u0e43\u0e08\u0e27\u0e48\u0e32\u0e04\u0e38\u0e13\u0e44\u0e14\u0e49\u0e40\u0e0a\u0e37\u0e48\u0e2d\u0e21\u0e15\u0e48\u0e2d\u0e2d\u0e34\u0e19\u0e40\u0e15\u0e2d\u0e23\u0e4c\u0e40\u0e19\u0e15 \u0e41\u0e25\u0e30\u0e1e\u0e22\u0e32\u0e22\u0e32\u0e21\u0e17\u0e35\u0e48\u0e08\u0e30\u0e42\u0e2b\u0e25\u0e14\u0e2b\u0e19\u0e49\u0e32\u0e43\u0e2b\u0e21\u0e48",
