    "Error getting task history for problem '<%- problem_id %>' and student '<%- student_id %>'. Make sure that the problem and student identifiers are complete and correct.": "L\u1ed7i ki\u1ec3m tra qua tr\u00ecnh l\u00e0m b\u00e0i '<%- problem_id %>' c\u1ee7a sinh vi\u00ean '<%- student_id %>'. H\u00e3y ki\u1ec3m tra xem t\u00ean c\u1ee7a c\u00e2u h\u1ecfi v\u00e0 t\u00ean c\u1ee7a h\u1ecdc vi\u00ean vi\u1ebft \u0111\u00e3 \u0111\u1ea7y \u0111\u1ee7 v\u00e0 \u0111\u00fang ch\u01b0a.",
