    "The country or region where you live.": "Qu\u1ed1c gia ho\u1eb7c n\u01a1i b\u1ea1n sinh s\u1ed1ng.",
    "The country that team members primarily identify with.": "\u0e1b\u0e23\u0e30\u0e40\u0e17\u0e28\u0e17\u0e35\u0e48\u0e2a\u0e21\u0e32\u0e0a\u0e34\u0e01\u0e2a\u0e48\u0e27\u0e19\u0e43\u0e2b\u0e0d\u0e48\u0e2d\u0e32\u0e28\u0e31\u0e22\u0e2d\u0e22\u0e39\u0e48",
    "The course end date must be later than the course start date.": "\u0e27\u0e31\u0e19\u0e2a\u0e38\u0e14\u0e17\u0e49\u0e32\u0e22\u0e02\u0e2d\u0e07\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23\u0e15\u0e49\u0e2d\u0e07\u0e2d\u0e22\u0e39\u0e48\u0e2b\u0e25\u0e31\u0e07\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e40\u0e23\u0e34\u0e48\u0e21\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23",
    "The course must have an assigned start date.": "\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23\u0e15\u0e49\u0e2d\u0e07\u0e21\u0e35\u0e01\u0e32\u0e23\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e40\u0e23\u0e34\u0e48\u0e21\u0e15\u0e49\u0e19\u0e17\u0e35\u0e48\u0e41\u0e19\u0e48\u0e19\u0e2d\u0e19",
    "The course start date must be later than the enrollment start date.": "\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e40\u0e23\u0e34\u0e48\u0e21\u0e40\u0e23\u0e35\u0e22\u0e19\u0e15\u0e49\u0e2d\u0e07\u0e2d\u0e22\u0e39\u0e48\u0e2b\u0e25\u0e31\u0e07\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e40\u0e23\u0e34\u0e48\u0e21\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19",
    "The email address you've provided isn't formatted correctly.": "\u0110\u1ecba ch\u1ec9 email b\u1ea1n cung c\u1ea5p kh\u00f4ng h\u1ee3p l\u1ec7.",
    "The enrollment end date cannot be after the course end date.": "\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e2a\u0e34\u0e49\u0e19\u0e2a\u0e38\u0e14\u0e01\u0e32\u0e23\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19\u0e40\u0e23\u0e35\u0e22\u0e19\u0e15\u0e49\u0e2d\u0e07\u0e44\u0e21\u0e48\u0e2d\u0e22\u0e39\u0e48\u0e2b\u0e25\u0e31\u0e07\u0e27\u0e31\u0e19\u0e1b\u0e34\u0e14\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23",
    "The enrollment start date cannot be after the enrollment end date.": "\u0e27\u0e31\u0e19\u0e17\u0e35\u0e48\u0e40\u0e23\u0e34\u0e48\u0e21\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19\u0e40\u0e23\u0e35\u0e22\u0e19\u0e15\u0e49\u0e2d\u0e07\u0e44\u0e21\u0e48\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e40\u0e1b\u0e47\u0e19\u0e27\u0e31\u0e19\u0e2b\u0e25\u0e31\u0e07\u0e08\u0e32\u0e01\u0e27\u0e31\u0e19\u0e2a\u0e34\u0e49\u0e19\u0e2a\u0e38\u0e14\u0e01\u0e32\u0e23\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19\u0e40\u0e23\u0e35\u0e22\u0e19",
    "The file must be at least {size} in size.": "\u0e44\u0e1f\u0e25\u0e4c\u0e15\u0e49\u0e2d\u0e07\u0e21\u0e35\u0e02\u0e19\u0e32\u0e14\u0e2d\u0e22\u0e48\u0e32\u0e07\u0e19\u0e49\u0e2d\u0e22 {size} ",
    "The file must be smaller than {size} in size.": "\u0e44\u0e1f\u0e25\u0e4c\u0e15\u0e49\u0e2d\u0e07\u0e21\u0e35\u0e02\u0e19\u0e32\u0e14\u0e40\u0e25\u0e47\u0e01\u0e01\u0e27\u0e48\u0e32 {size} ",
    "The following email addresses and/or usernames are invalid:": "\u0e2d\u0e35\u0e40\u0e21\u0e25\u0e4c\u0e2b\u0e23\u0e37\u0e2d\u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e44\u0e21\u0e48\u0e16\u0e39\u0e01\u0e15\u0e49\u0e2d\u0e07",
    "The following errors were generated:": "\u0e04\u0e27\u0e32\u0e21\u0e1c\u0e34\u0e14\u0e1e\u0e25\u0e32\u0e14\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07:",
    "The following message will be displayed at the bottom of the courseware pages within your course:": "Th\u00f4ng b\u00e1o sau s\u1ebd \u0111\u01b0\u1ee3c hi\u1ec3n th\u1ecb \u1edf d\u01b0\u1edbi c\u00f9ng c\u1ee7a c\u00e1c trang gi\u00e1o tr\u00ecnh kh\u00f3a h\u1ecdc c\u1ee7a b\u1ea1n:",
    "The following options are available for the {license_name} license.": "C\u00e1c t\u00f9y ch\u1ecdn sau c\u00f3 th\u1ec3 d\u00f9ng cho gi\u1ea5y ph\u00e9p {license_name}.",
    "The following users are no longer enrolled in the course:": "\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e44\u0e21\u0e48\u0e44\u0e14\u0e49\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19\u0e2d\u0e22\u0e39\u0e48\u0e43\u0e19\u0e23\u0e32\u0e22\u0e27\u0e34\u0e0a\u0e32\u0e19\u0e35\u0e49\u0e2d\u0e35\u0e01\u0e15\u0e48\u0e2d\u0e44\u0e1b",
    "The following warnings were generated:": "\u0e04\u0e33\u0e40\u0e15\u0e37\u0e2d\u0e19\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07:",
    "The general category for this type of assignment, for example, Homework or Midterm Exam. This name is visible to learners.": "Danh m\u1ee5c chung cho lo\u1ea1i b\u00e0i t\u1eadp n\u00e0y, v\u00ed d\u1ee5: B\u00e0i t\u1eadp v\u1ec1 nh\u00e0 ho\u1eb7c B\u00e0i ki\u1ec3m tra gi\u1eefa k\u1ef3. T\u00ean n\u00e0y hi\u1ec3n th\u1ecb cho ng\u01b0\u1eddi h\u1ecdc.",
    "The grading process is still running. Refresh the page to see updates.": "\u0110ang trong qu\u00e1 tr\u00ecnh ch\u1ea5m \u0111i\u1ec3m. Refresh l\u1ea1i trang \u0111\u1ec3 xem c\u1eadp nh\u1eadt m\u1edbi.",
    "The language that team members primarily use to communicate with each other.": "\u0e20\u0e32\u0e29\u0e32\u0e17\u0e35\u0e48\u0e2a\u0e21\u0e32\u0e0a\u0e34\u0e01\u0e43\u0e19\u0e17\u0e35\u0e21\u0e43\u0e0a\u0e49\u0e40\u0e1b\u0e47\u0e19\u0e20\u0e32\u0e29\u0e32\u0e2b\u0e25\u0e31\u0e01\u0e43\u0e19\u0e01\u0e32\u0e23\u0e2a\u0e19\u0e17\u0e19\u0e32",
    "The language used throughout this site. This site is currently available in a limited number of languages. Changing the value of this field will cause the page to refresh.": "Ng\u00f4n ng\u1eef \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng tr\u00ean to\u00e0n b\u1ed9 trang web. Trang web n\u00e0y hi\u1ec7n ch\u1ec9 c\u00f3 s\u0103n m\u1ed9t s\u1ed1 ng\u00f4n ng\u1eef. Thay \u0111\u1ed5i gi\u00e1 tr\u1ecb c\u1ee7a tr\u01b0\u1eddng n\u00e0y s\u1ebd l\u00e0m m\u1edbi trang.",
    "The minimum grade for course credit is not set.": "\u0e44\u0e21\u0e48\u0e44\u0e14\u0e49\u0e15\u0e31\u0e49\u0e07\u0e04\u0e48\u0e32\u0e40\u0e01\u0e23\u0e14\u0e02\u0e31\u0e49\u0e19\u0e15\u0e48\u0e33\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e2b\u0e19\u0e48\u0e27\u0e22\u0e01\u0e34\u0e15\u0e2b\u0e25\u0e31\u0e01\u0e2a\u0e39\u0e15\u0e23",
    "The minimum score percentage must be a whole number between 0 and 100.": "T\u1ec9 l\u1ec7 \u0111i\u1ec3m s\u1ed1 ph\u1ea3i l\u00e0 con s\u1ed1 trong kho\u1ea3ng t\u1eeb 0 \u0111\u1ebfn 100",
    "The name of this signatory as it should appear on certificates.": "\u0e0a\u0e37\u0e48\u0e2d\u0e02\u0e2d\u0e07\u0e1c\u0e39\u0e49\u0e25\u0e07\u0e19\u0e32\u0e21\u0e04\u0e27\u0e23\u0e08\u0e30\u0e1b\u0e23\u0e32\u0e01\u0e0f\u0e1a\u0e19\u0e1b\u0e23\u0e30\u0e01\u0e32\u0e28\u0e19\u0e35\u0e22\u0e1a\u0e31\u0e15\u0e23",
    "The name that identifies you on {platform_name}. You cannot change your username.": "T\u00ean \u0111\u1ecbnh danh b\u1ea1n tr\u00ean {platform_name}. B\u1ea1n kh\u00f4ng th\u1ec3 thay \u0111\u1ed5i t\u00ean \u0111\u0103ng nh\u1eadp.",
    "The name that is used for ID verification and that appears on your certificates.": "T\u00ean \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 x\u00e1c minh ID v\u00e0 xu\u1ea5t hi\u1ec7n tr\u00ean ch\u1ee9ng ch\u1ec9 c\u1ee7a b\u1ea1n.",
    "The number of assignments of this type that will be dropped. The lowest scoring assignments are dropped first.": "S\u1ed1 l\u01b0\u1ee3ng b\u00e0i t\u1eadp thu\u1ed9c lo\u1ea1i n\u00e0y s\u1ebd b\u1ecb lo\u1ea1i b\u1ecf. Nh\u1eefng b\u00e0i t\u1eadp c\u00f3 \u0111i\u1ec3m th\u1ea5p s\u1ebd b\u1ecb lo\u1ea1i b\u1ecf tr\u01b0\u1edbc.",
    "The number of subsections in the course that contain problems of this assignment type.": "S\u1ed1 ph\u1ea7n con trong kh\u00f3a h\u1ecdc ch\u1ee9a c\u00e1c c\u00e2u h\u1ecfi c\u1ee7a lo\u1ea1i b\u00e0i t\u1eadp n\u00e0y.",
    "The organization that this signatory belongs to, as it should appear on certificates.": "\u0e2d\u0e07\u0e04\u0e4c\u0e01\u0e23\u0e17\u0e35\u0e48\u0e25\u0e07\u0e19\u0e32\u0e21\u0e04\u0e23\u0e31\u0e49\u0e07\u0e19\u0e35\u0e49\u0e04\u0e27\u0e23\u0e08\u0e30\u0e1b\u0e23\u0e32\u0e01\u0e0f\u0e1a\u0e19\u0e1b\u0e23\u0e30\u0e01\u0e32\u0e28\u0e19\u0e35\u0e22\u0e1a\u0e31\u0e15\u0e23",
    "The page \"{route}\" could not be found.": "Kh\u00f4ng th\u1ea5y trang \"{route}\".",
