    "The published branch version, {published}, was reset to the draft branch version, {draft}.": "Phi\u00ean b\u1ea3n nh\u00e1nh \u0111\u00e3 xu\u1ea5t b\u1ea3n, {published}, \u0111\u00e3 \u0111\u01b0\u1ee3c \u0111\u1eb7t l\u1ea1i th\u00e0nh phi\u00ean b\u1ea3n nh\u00e1nh d\u1ef1 th\u1ea3o, {draft}.",
    "The raw error message is:": "\u0e02\u0e49\u0e2d\u0e1c\u0e34\u0e14\u0e1e\u0e25\u0e32\u0e14\u0e40\u0e1a\u0e37\u0e49\u0e2d\u0e07\u0e15\u0e49\u0e19\u0e04\u0e37\u0e2d:",
    "The refund deadline for this course has passed,so you will not receive a refund.": "Th\u1eddi h\u1ea1n ho\u00e0n tr\u1ea3 c\u1ee7a kh\u00f3a h\u1ecdc n\u00e0y \u0111\u00e3 \u0111\u01b0\u1ee3c qua, v\u00ec v\u1eady b\u1ea1n s\u1ebd kh\u00f4ng nh\u1eadn \u0111\u01b0\u1ee3c ti\u1ec1n ho\u00e0n l\u1ea1i.",
    "The selected content group does not exist": "\u0e01\u0e25\u0e38\u0e48\u0e21\u0e40\u0e19\u0e37\u0e49\u0e2d\u0e2b\u0e32\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e44\u0e21\u0e48\u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48",
    "The selected image must be larger than {minFileSizeInKB}.": "H\u00ecnh \u1ea3nh \u0111\u01b0\u1ee3c ch\u1ecdn ph\u1ea3i l\u1edbn h\u01a1n {minFileSizeInKB}.",
    "The selected image must be smaller than {maxFileSizeInMB}.": "H\u00ecnh \u1ea3nh \u0111\u01b0\u1ee3c ch\u1ecdn ph\u1ea3i nh\u1ecf h\u01a1n {maxFileSizeInMB}.",
    "The server could not be contacted.": "\u0e44\u0e21\u0e48\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e15\u0e34\u0e14\u0e15\u0e48\u0e2d\u0e40\u0e0b\u0e34\u0e1f\u0e40\u0e27\u0e2d\u0e23\u0e4c",
    "The submission could not be removed from the grading pool.": "\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e44\u0e21\u0e48\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e25\u0e1a\u0e2d\u0e2d\u0e01\u0e08\u0e32\u0e01\u0e1c\u0e25\u0e01\u0e32\u0e23\u0e43\u0e2b\u0e49\u0e04\u0e30\u0e41\u0e19\u0e19",
    "The team \"{team}\" could not be found.": "Kh\u00f4ng th\u1ea5y nh\u00f3m \"{team}\".",
    "The timed transcript for the first video file does not appear to be the same as the timed transcript for the second video file.": "B\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho t\u1ec7p video \u0111\u1ea7u kh\u00f4ng kh\u1edbp v\u1edbi b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho t\u1ec7p video th\u1ee9 hai.",
    "The timed transcript for this video on edX is out of date, but YouTube has a current timed transcript for this video.": "B\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y tr\u00ean edX \u0111\u00e3 l\u1ed7i th\u1eddi, nh\u01b0ng YouTube c\u00f3 b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian cho video n\u00e0y.",
    "The topic \"{topic}\" could not be found.": "Kh\u00f4ng th\u1ea5y ch\u1ee7 \u0111\u1ec1 \"{topic}\".",
    "The weight of all assignments of this type as a percentage of the total grade, for example, 40. Do not include the percent symbol.": "T\u1ef7 tr\u1ecdng c\u1ee7a t\u1ea5t c\u1ea3 c\u00e1c b\u00e0i t\u1eadp thu\u1ed9c lo\u1ea1i n\u00e0y l\u00e0 ph\u1ea7n tr\u0103m c\u1ee7a t\u1ed5ng s\u1ed1 \u0111i\u1ec3m, v\u00ed d\u1ee5, 40. Kh\u00f4ng bao g\u1ed3m bi\u1ec3u t\u01b0\u1ee3ng ph\u1ea7n tr\u0103m.",
    "The {cohortGroupName} cohort has been created. You can manually add students to this cohort below.": "\u0e01\u0e25\u0e38\u0e48\u0e21\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e19{cohortGroupName}\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e02\u0e36\u0e49\u0e19\u0e21\u0e32 \u0e04\u0e38\u0e13\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e40\u0e1e\u0e34\u0e48\u0e21\u0e1c\u0e39\u0e49\u0e40\u0e23\u0e35\u0e22\u0e19\u0e40\u0e02\u0e49\u0e32\u0e44\u0e1b\u0e43\u0e19\u0e01\u0e25\u0e38\u0e48\u0e21\u0e14\u0e49\u0e32\u0e19\u0e25\u0e48\u0e32\u0e07\u0e19\u0e35\u0e49",
    "There are invalid keywords in your email. Check the following keywords and try again.": "C\u00f3 nh\u1eefng t\u1eeb kh\u00f3a kh\u00f4ng h\u1ee3p l\u1ec7 trong email c\u1ee7a b\u1ea1n. Ki\u1ec3m tra c\u00e1c t\u1eeb kh\u00f3a sau \u0111\u00e2y v\u00e0 th\u1eed l\u1ea1i.",
    "There are no posts in this topic yet.": "Ch\u01b0a c\u00f3 \u0111i\u1ec3m trong ch\u1ee7 \u0111\u1ec1 n\u00e0y.",
