    "Year of Birth": "\u0e1b\u0e35\u0e17\u0e35\u0e48\u0e40\u0e01\u0e34\u0e14",
    "Yes, allow edits to the active Certificate": "\u0e43\u0e0a\u0e48 \u0e2d\u0e19\u0e38\u0e0d\u0e32\u0e15\u0e01\u0e32\u0e23\u0e41\u0e01\u0e49\u0e44\u0e02\u0e44\u0e1b\u0e22\u0e31\u0e07\u0e43\u0e1a\u0e23\u0e31\u0e1a\u0e23\u0e2d\u0e07\u0e17\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e2d\u0e22\u0e39\u0e48",
    "Yes, delete this {xblock_type}": "\u0110\u1ed3ng \u00fd, xo\u00e1 {xblock_type}",
    "Yes, replace the edX transcript with the YouTube transcript": "C\u00f3, thay th\u1ebf b\u1ea3n d\u1ecbch edX b\u1eb1ng b\u1ea3n d\u1ecbch c\u1ee7a YouTube",
