    "Your library could not be exported to XML. There is not enough information to identify the failed component. Inspect your library to identify any problematic components and try again.": "Kh\u00f4ng th\u1ec3 xu\u1ea5t th\u01b0 vi\u1ec7n c\u1ee7a b\u1ea1n sang XML. Kh\u00f4ng c\u00f3 \u0111\u1ee7 th\u00f4ng tin \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh th\u00e0nh ph\u1ea7n g\u1eb7p l\u1ed7i. Ki\u1ec3m tra l\u1ea1i th\u01b0 vi\u1ec7n c\u1ee7a b\u1ea1n \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh c\u00e1c th\u00e0nh ph\u1ea7n c\u00f3 v\u1ea5n \u0111\u1ec1 v\u00e0 th\u1eed l\u1ea1i.",
